          <option value="Order By Name A-Z">A - Z</option>
          <option value="Order By Name Z-A">Z - A</option>
          <option value="Attack">Attack</option>
        </select>


        <select defaultValue='Order By...' onChange={secondFilter}>
          <option disabled>Order By...</option>
          <option value="all">All</option>
          <option value="Created by you">Created by you</option>
          <option value="Order By Type">Type</option>
        </select>
        
  
        <div>
            <SearchBar/>
        </div>
    
    </div>


  )
}
